import React from "react";
import EditOrCreateOpinion from "./EditOrCreateOpinion";

export default function EOCButtonOpinion(props) {
  return (
    <div>
      <br />
      <EditOrCreateOpinion
        id={props.oid}
        forClosing={null}
        allDATA={props.allDATA}
      />
    </div>
  );
}
